	Plugin.prototype.updateCalculation = function(data)
	{
        var ui;
        if (data.error === true) {
            ui = $(Mustache.render(this.errorTemplate, data));
            this.gaEvent('Calculator', 'Error Result', 'Error Result');
        } else {
            ui = $(Mustache.render(this.resultTemplate, data));
            this.gaEvent('Calculator', 'Success Result', 'Success Result');
        }
        var button = $('form.calculator').find('button');
        button.attr('disabled', true);
        $('body').append(ui);
        var plugin = this;
        var close = function() {
            plugin.resultSheetOpen = false;
            plugin.showHeader();
            ui.animateCss('slideOutLeft', function() {
                ui.remove();
                button.attr('disabled', false);
            });
        }

        ui.css('display', 'block');

        // Close when close button is clicked
        ui.find('.close').click(function(e) {
            e.preventDefault();
            close();
            return false;
        });

        // Close with escape key
        $(document).keyup(function(e) {
            if (e.keyCode == 27) {
                close();
            }
        });
        this.hideHeader();
        ui.animateCss('slideInRight');
        this.resultSheetOpen = true;
	};


